const { createApp, onMounted } = window.Vue
const { decoder } = window.gifViewer || {}

createApp({
  template: `
    <input type="file" @change="fileChange">
  `,
  setup () {

    const fileChange = async ({ target: { files } }) => {
      const [file] = files
      const dataUrl = await new Promise(resolve => {
        const fileReader = new FileReader()
        fileReader.onload = () => resolve(fileReader.result)
        fileReader.readAsDataURL(file)
      })
      const blob = await (await fetch(dataUrl)).blob()
      const gif = await decoder(blob)
      console.log(gif)
    }

    onMounted(async () => {

      // const GIF_SOURCE = 'data:image/gif;base64,R0lGODlhCgAKAJEAAP////8AAAAA/wAAACH5BAAAAAAALAAAAAAKAAoAAAIWjC2Zhyoc3DOgAnXslfqo3mCMBJFMAQA7'
      // const GIF_SOURCE = 'data:image/gif;base64,'
      // const GIF_SOURCE = 'data:image/gif;base64,'

      const GIF_SOURCE = 'data:image/gif;base64,'

      const blob = await (await fetch(GIF_SOURCE)).blob()

      const gif = await decoder(blob)

      console.log(gif)
    })

    return {
      fileChange
    }
  }
}).mount('#app')
